    true,nt"url": null,nt"notes": "Dynamic Ocean Track System Plus (DOTS Plus)
    is a planning tool implemented at the ZOA, ZAN, and ZNY ARTCCs. It is utilized by
    Traffic Management Unit (TMU) personnel to generate fuel optimized flexible oceanic
    tracks, and to meter traffic on flexible oceanic tracks  To achieve these objectives,
    the DOTS Plus provides the following capabilities: A Track Generation (TG) function,
    used to create and publish flexible tracks for an oceanic area, optimized for the
    greatest fuel efficiency (based on the latest weather forecast and area separation
    requirements). Tracks are generated within a predefined network, between a user
    entered departure and arrival point. Weather forecast data is received (4 times
    daily) from which DOTS Plus generates a displayable weather model.  Publishing tracks
    entails transmitting messages defining the tracks to appropriate systems/users.
